// Central place to manage the Google Maps API key
// Option 1 (recommended): set REACT_APP_GOOGLE_MAPS_API_KEY in your .env file
// Option 2: directly paste your key below as a fallback

export const GOOGLE_MAPS_API_KEY =
  process.env.REACT_APP_GOOGLE_MAPS_API_KEY || 'YOUR_GOOGLE_MAPS_API_KEY_HERE';
